import classNames from 'classnames/bind';
import style from './Register.module.scss';
import { SpotifyIcon } from '../../assets/Icon';

const cx = classNames.bind(style);

function Register() {
    return (
        <div className={cx('wrapper')}>
            <div className={cx('container')}>
                <div className={cx('header-container')}>
                    <span>
                        <SpotifyIcon width="4rem" height="4rem" />
                    </span>
                    <span className={cx('header-container-title')}>Sign up to</span>
                    <span className={cx('header-container-title')}>start listening</span>
                </div>
                <div className={cx('input-info')}></div>
            </div>
        </div>
    );
}

export default Register;
